 Conheça o Mahabat ka Maqbara. 

Assim como o famoso Taj Mahal da cidade de Agra, a versão neogótica também é um mausoléu.

 Foi construído em 1892, mais de dois séculos após o mausoléu erguido pelo imperador Shah Jahan em homenagem a sua amada  esposa Mumtaz Mahal. 

O Taj neogótico fica em Junagadh, no estado do Gujarat. É de cair o queixo a mistura arquitetônica de estilos neogótico e indo-islamico.

 Essa exótica construção abriga o corpo do Vizir Bahaduddinbhai Hasainbhai, um chefe nobre da Corte do Nababo Mahabat Khan II. 

Vizir era um cargo político importante para os antigos reis da Persia. 

Nababo era um título de nobreza de muçulmanos na Índia. 

Alguns estados indianos eram governados por nababos antigamente e eles costumavam construir mausoléus, seguindo a tradição muçulmana. 

Um detalhe curioso: a  versão neogótica tem escadas do lado de fora dos minaretes. 

